window.bookSummaryJSON = "<p>Heinrich de Gramont's petition to the king to release Max Renard from his duty to serve at Westerly Fort has been signed. Max's debt to the crown has been paid. And now his \"doting\" uncle expects his wayward and petulant nephew to come to the capital at once so he can be wed to Viscountess Aurelie de Marbot.</p> <p>Max knows there's no getting out of a trip to the capital this time. Also, beyond personal affairs, he has a lot of questions both for his father's brother and a number of maternal relatives. And so, Max decides to make for Herouxville to see with his own eyes just how far blood ties can take him.</p>"; 
